properties.description:
A Roman&nbsp;silver denarius of Augustus (27&nbsp;BC-AD&nbsp;14) dating to the period c. 2&nbsp;BC-AD&nbsp;4 (Reece Period 1).&nbsp;

C L CAESARES AVGVSTI F COS DESIG PRINC IVVENT reverse type depicting Caius and Lucius Caesars standing facing holding spears and shields; simpulum and lituus above. Some of the coin is missing between 7 &amp; 8 o&#39;clock on the obverse.

RIC&nbsp;I (2nd ed.), p. 55, no. 207.&nbsp;Measurements: Diameter: 18.9mm; weight: 3.1g. Die Axis: 7.

